import React, { Component} from 'react';
import "./films.css"
import Film from '../Film/Film';
import filmlist from '../../data/films'

class Films extends Component {
    render(){
        console.log(filmlist)
        return(
            <ul>
                {filmlist.map( film => (
                    <Film 
                    title={film.name}
                    critic_consensus={film.critic_consensus}
                    plot={film.plot}
                    url={film.url}
                    url={film.url}
                    />
                ))}
            </ul>
        )
    }
}

export default Films;
